1b\u043e\u0441\u0442, \u042d\u0436\u0435\u043d \u041e\u0433\u044e\u0441\u0442\u0435\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0440\u0443\u0441\u0441\u043a.<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u0432 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0442\u0435\u0445\u043d\u0438\u043a\u0443 \u0437\u0430\u043f\u0438\u0441\u0438 \u0437\u0432\u0443\u043a\u0430 \u043a \u043a\u0438\u043d\u043e\u0444\u0438\u043b\u044c\u043c\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043e\u0445\u043e\u0434 \u00ab\u0410\u0440\u0430\u043f\u0430\u043e\u044d\u00bb, \u0437\u0430\u0434\u0440\u0435\u0439\u0444\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u043f\u043e \u043f\u0443\u0442\u0438 \u0438\u0437 \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%B5%D0%BA%D1%81%D0%BE%D0%BD%D0%B2%D0%B8%D0%BB%D0%BB\" class=\"mw-redirect\" title=\"\u0414\u0436\u0435\u043a\u0441\u043e\u043d\u0432\u0438\u043b\u043b\">\u0414\u0436\u0435\u043a\u0441\u043e\u043d\u0432\u0438\u043b\u043b<\/a>, \u043f\u0435\u0440\u0432\u044b\u043c \u0432 \u043c\u0438\u0440\u0435 \u043f\u0435\u0440\u0435\u0434\u0430\u043b \u043f\u043e \u0440\u0430\u0434\u0438\u043e \u0441\u0438\u0433\u043d\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/SOS\" title=\"SOS\">SOS<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0432\u044b\u0448\u043b\u043e \u043f\u043