38\u0435 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%98%D1%83%D0%B4%D0%B5_%D0%98%D1%81%D0%BA%D0%B0%D1%80%D0%B8%D0%BE%D1%82%D1%83&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0418\u0443\u0434\u0435 \u0418\u0441\u043a\u0430\u0440\u0438\u043e\u0442\u0443 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430<\/a> \u043c\u043e\u0433\u043b\u043e \u0441\u043e\u0441\u0442\u043e\u044f\u0442\u044c\u0441\u044f \u0442\u0430\u043a\u0436\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/12_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0\" title=\"12 \u0430\u0432\u0433\u0443\u0441\u0442\u0430\">12 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a>. \u0421\u043f\u0443\u0441\u0442\u044f \u0434\u0432\u0435 \u043d\u0435\u0434\u0435\u043b\u0438 \u043e\u043d \u0431\u0435\u0441\u0441\u043b\u0435\u0434\u043d\u043e \u0438\u0441\u0447\u0435\u0437.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f\">\u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u043c\u0443\u0437\u0435\u0439-\u0443\u0441\u0430\u0434\u044c\u0431\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D1%80%D0%B0%D0%BC%D1%86%D0%B5%D0%B2%D0%BE_(%D0%BC%D1%83%D0%B7%D0%B5%D0%B9-%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA)\" title=\"\u0410\u0431\u0440\u0430\u043c\u0446\u0435\u0432\u043e (\u043c\u0443\u0437\u0435\u0439-\u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a)\">\u0410\u0431\u0440\u0430\u043c\u0446\u0435\u0432\u043e<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BA%D0%B0%D0%B7_(%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B0%D0%BA%D1%82)\" title=\"\u041d\u0430\u043a\u0430\u0437 (\u043f\u0440\u0430\u0432\u043e\u0432\u043e\u0439 \u0430\u043a\u0442)\">\u043d\u0430\u043a\u0430\u0437<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%9A%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442 \u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u041a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0420\u0421\u0424\u0421\u0420\">\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\u0430<\/a> \u043e \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0432 \u0436\u0438\u0437\u043d\u044c \u043d\u043e\u0432\u043e\u0439 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D1%8D%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u041d\u043e\u0432\u0430\u044f \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0430\">\u041d\u042d\u041f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0441\u043b\u043e\u0432 \u0433\u0438\u043c\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u0443\u043f\u043b\u0435\u0442 \u0441\u0442\u0438\u0445\u043e\u0432 \u00ab\u0414\u043e\u0439\u0447\u043b\u0430\u043d\u0434, \u0414\u043e\u0439\u0447\u043b\u0430\u043d\u0434 \u044e\u0431\u0435\u0440 \u0430\u043b\u043b\u0435\u0441\u00bb, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1848_%D0%B3%D0%BE%D0%B4\" title=\"1848 \u0433\u043e\u0434\">1848 \u0433\u043e\u0434\u0443<\/a> \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%84%D0%BC%D0%B0%D0%BD_%D1%84%D0%BE%D0%BD_%D0%A4%D0%B0%D0%BB%D0%BB%D0%B5%D1%80%D1%81%D0%BB%D0%B5%D0%B1%D0%B5%D0%BD,_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85\" title=\"\u0413\u043e\u0444\u043c\u0430\u043d \u0444\u043e\u043d \u0424\u0430\u043b\u043b\u0435\u0440\u0441\u043b\u0435\u0431\u0435\u043d, \u0410\u0432\u0433\u0443\u0441\u0442 \u0413\u0435\u043d\u0440\u0438\u0445\">\u0410\u0432\u0433\u0443\u0441\u0442\u043e\u043c \u0413\u0435\u043d\u0440\u0438\u0445\u043e\u043c \u0413\u043e\u0444\u043c\u0430\u043d\u043e\u043c \u0424\u043e\u043d \u0424\u0430\u043b\u043b\u0435\u0440\u0441\u043b\u0435\u0431\u0435\u043d\u043e\u043c<\/a>. \u041c\u0443\u0437\u044b\u043a\u043e\u0439 \u0433\u0438\u043c\u043d\u0430 \u0441\u0442\u0430\u043b\u0430 \u043c\u0435\u043b\u043e\u0434\u0438\u044f, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B9%D0%B4%D0%BD,_%D0%99%D0%BE%D0%B7%D0%B5%D1%84\" title=\"\u0413\u0430\u0439\u0434\u043d, \u0419\u043e\u0437\u0435\u0444\">\u0419\u043e\u0437\u0435\u0444\u043e\u043c \u0413\u0430\u0439\u0434\u043d\u043e\u043c<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1797_%D0%B3%D0%BE%D0%B4\" title=\"1797 \u0433\u043e\u0434\">1797 \u0433\u043e\u0434\u0443<\/a> \u043a\u0430\u043a \u0433\u0438\u043c\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>. \u041f\u043e\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u0433\u0438\u043c\u043d \u0431\u044b\u043b \u043e\u0442\u043c\u0435\u043d\u0451\u043d, \u043d\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950 \u0433\u043e\u0434\u0443<\/a> \u0432\u043d\u043e\u0432\u044c \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d \u0441\u043e \u0441\u043b\u043e\u0432\u0430\u043c\u0438 \u0442\u0440\u0435\u0442\u044c\u0435\u0433