><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0418\u0440\u0430\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BA\" title=\"\u0418\u0440\u0430\u043a\">\u0418\u0440\u0430\u043a<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0434\u0440\u0443\u0436\u0431\u0435.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%8E%D1%80%D0%B8%D1%85\" title=\"\u0426\u044e\u0440\u0438\u0445\">\u0426\u044e\u0440\u0438\u0445\u0435<\/a> \u0441\u043e\u0437\u0434\u0430\u043d\u043e \u0410\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u043f\u043e \u043e\u0442\u043f\u0440\u0430\u0432\u043a\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D0%B5%D1%81%D1%82%D0%B8%D0%BD%D0%B0\" title=\"\u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0430\">\u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0435\u0432<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u043d\u0430\u0446\u0438\u0441\u0442\u0430\u043c\u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%82%D1%82%D0%BE_%D0%B2_%D0%98%D0%B2%D0%B0%D1%86%D0%B5%D0%B2%D0%B8%D1%87%D0%B0%D1%85\" title=\"\u0413\u0435\u0442\u0442\u043e \u0432 \u0418\u0432\u0430\u0446\u0435\u0432\u0438\u0447\u0430\u0445\">\u0433\u0435\u0442\u0442\u043e \u0432 \u0418\u0432\u0430\u0446\u0435\u0432\u0438\u0447\u0430\u0445<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5