37\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043f\u0440\u0438\u0432\u0435\u0434\u0451\u0442 \u043a \u043a\u043e\u043d\u0446\u0443 \u0441\u0432\u0435\u0442\u0430; \u00ab\u043f\u043e\u0441\u043b\u0435 \u0442\u0440\u0451\u0445 \u0434\u043d\u0435\u0439 \u0438 \u0442\u0440\u0451\u0445 \u043d\u043e\u0447\u0435\u0439 \u0443\u0436\u0430\u0441\u0430\u044e\u0449\u0438\u0445 \u0431\u0435\u0434\u0441\u0442\u0432\u0438\u0439 \u0441\u043f\u0430\u0441\u0443\u0442\u0441\u044f \u043b\u0438\u0448\u044c \u0447\u0438\u0441\u0442\u044b\u0435 \u043f\u0435\u0440\u0435\u0434 \u0411\u043e\u0433\u043e\u043c \u043b\u044e\u0434\u0438\u00bb. \u0418\u0435\u0440\u043e\u043c\u043e\u043d\u0430\u0445 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u044d\u0442\u043e \u0430\u043f\u043e\u043a\u0430\u043b\u0438\u043f\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 \u0421\u0432\u044f\u0442\u043e\u0439 \u0433\u043e\u0440\u0435 \u0410\u0444\u043e\u043d, \u043a\u0443\u0434\u0430 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0430\u043b\u043e\u043c\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003_%D0%B3%D0%BE%D0%B4\" title=\"2003 \u0433\u043e\u0434\">2003<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE%D0%B0%D1%82%D0%BB%D0%B0%D0%BD%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80%D0%B0\" class=\"mw-redirect\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0421\u0435\u0432\u0435\u0440\u043e\u0430\u0442\u043b\u0430\u043d\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430\">\u041d\u0410\u0422\u041e<\/a> \u043f\u0440\u0438\u043d\u044f\u